import {QuizRound} from "src/app/model/QuizRound";
import IQuizService from "src/app/services/IQuizService";
import questions from "src/app/data.json";

interface questionsElement {
	question: string;
	choices: string[];
	rightAnswer: string;
	key: string;
}

// Class which describe path for get data
export class QuizServiceStub implements IQuizService {

  public pathToData: string;

  constructor(serviceConfig: string) {
    this.pathToData = serviceConfig;
  }

  // Method which return data
  public async getData(): Promise<QuizRound[]> {
    const question = questions.map((questionsElement: questionsElement) => new Quiz);

    return questions as QuizRound[];
  }

}
